import React from "react";
import Navigation from "../components/Navigation";
import styled from "styled-components";

const StyledBody = styled.div`
  background: url("./home_bg.png") no-repeat;
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  width: 100%;
  height: 100%;
`;

const Home = () => {
  return (
    <StyledBody>
      <div class="container">
        <div className="main">
          <Navigation />
          <div class="step">
            <div>
              <p>Welcome to</p>
            </div>
            <div>
              <h1>E-smart rentals charlotte</h1>
            </div>
          </div>
        </div>
      </div>
    </StyledBody>
  );
};

export default Home;
